import React from 'react';
import './Boxes.css';
import dog from './dog.png';

const Boxes = ({ name }) => {
	return (
		<li>
			<ul className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow5'>
				<img alt='golden' src={dog} />
				<div>
					  <h2>golden</h2>
					  <p>150</p>
				</div>
			</ul>
			<ul className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow5'>
				<img alt='golden' src={dog} />
				<div>
					  <h2>Huski</h2>
					  <p>150</p>
				</div>
			</ul>
		</li>
	);
}

export default Boxes;
